import React, { Component } from 'react';
import Row from 'react-bootstrap/lib/Row';
import Col from 'react-bootstrap/lib/Col';

class BlueCard extends Component {
  render() {
    return (
      <div className="card-blue push">
        <Row md={10}>Vegy is a curated platform that allows the visual search and discovery of new recipes, techniques and ingredients to inspire culinary adventures.</Row>
        <Row md={12} className="bold beta soft text-center"> VEGETERIAN </Row>
      </div>
    )
  }
}

export default BlueCard;
